atom-text-editor {
  background-color: #0f111b;
  color: #ecf0c1;
}
atom-text-editor .wrap-guide {
  background-color: rgba(153, 187, 255, 0.08);
}
atom-text-editor .indent-guide {
  color: #818596;
}
atom-text-editor .invisible-character {
  color: #818596;
}
atom-text-editor .gutter {
  background-color: #0f111b;
  color: #ecf0c1;
}
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #16172d;
  color: #7a5ccc;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #7a5ccc;
}
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
atom-text-editor .fold-marker:after {
  color: #c1c3cc;
}
atom-text-editor .invisible {
  color: #ecf0c1;
}
atom-text-editor .cursor {
  color: white;
}
atom-text-editor .selection .region {
  background-color: #1b1c36;
}
.syntax--comment {
  color: #30365F;
}
.syntax--comment .syntax--keyword.syntax--control {
  color: #e39400;
}
.syntax--comment .syntax--support.syntax--type {
  color: #ce6f8f;
  font-style: italic;
}
.syntax--comment .syntax--variable {
  color: #b3a1e6;
  font-style: italic;
}
.syntax--keyword {
  color: #e39400;
}
.syntax--keyword.syntax--control {
  color: #e39400;
}
.syntax--keyword.syntax--operator {
  color: #ce6f8f;
}
.syntax--keyword.syntax--setter {
  color: #00a3cc;
  font-style: italic;
}
.syntax--keyword.syntax--other.syntax--special-method {
  color: #b3a1e6;
}
.syntax--ruby .syntax--keyword.syntax--other.syntax--special-method,
.syntax--keyword.syntax--other.syntax--special-method.syntax--ruby {
  color: #ce6f8f;
}
.syntax--keyword.syntax--other.syntax--unit {
  color: #e39400;
}
.syntax--storage {
  color: #7a5ccc;
}
.syntax--constant {
  color: #f2ce00;
}
.syntax--constant.syntax--character.syntax--escape {
  color: #b3a1e6;
}
.syntax--constant.syntax--numeric {
  color: #f2ce00;
}
.syntax--constant.syntax--other.syntax--color {
  color: #00a3cc;
}
.syntax--constant.syntax--other.syntax--symbol {
  color: #7a5ccc;
}
.syntax--variable {
  color: #ecf0c1;
}
.syntax--variable.syntax--interpolation {
  color: #ce6f8f;
}
.syntax--variable.syntax--parameter.syntax--function {
  color: #e39400;
  font-style: italic;
}
.syntax--variable.syntax--list {
  color: #00a3cc;
}
.syntax--variable.syntax--constant {
  color: #7a5ccc;
}
.syntax--variable.syntax--instance {
  color: #7a5ccc;
  font-style: italic;
}
.syntax--invalid.syntax--illegal {
  background-color: #e33400;
  color: #0f111b;
}
.syntax--regexp .syntax--keyword.syntax--operator,
.syntax--regexp .syntax--storage.syntax--modifier {
  color: #e33400;
}
.syntax--string {
  color: #00a3cc;
}
.syntax--string.syntax--regexp {
  color: #e33400;
}
.syntax--string.syntax--regexp .syntax--source.syntax--ruby.syntax--embedded {
  color: #e39400;
}
.syntax--string.syntax--other.syntax--link {
  color: #00a3cc;
}
.syntax--punctuation {
  color: #ce6f8f;
}
.syntax--punctuation.syntax--bracket {
  color: #ecf0c1;
}
.syntax--punctuation.syntax--definition.syntax--bracket,
.syntax--punctuation.syntax--definition.syntax--curly {
  color: #ecf0c1;
}
.syntax--punctuation.syntax--definition.syntax--comment {
  color: #30365F;
}
.syntax--punctuation.syntax--definition.syntax--string,
.syntax--punctuation.syntax--definition.syntax--variable,
.syntax--punctuation.syntax--definition.syntax--parameters,
.syntax--punctuation.syntax--definition.syntax--array {
  color: #ecf0c1;
}
.syntax--ruby .syntax--punctuation.syntax--definition.syntax--string,
.syntax--ruby .syntax--punctuation.syntax--definition.syntax--variable,
.syntax--ruby .syntax--punctuation.syntax--definition.syntax--parameters,
.syntax--ruby .syntax--punctuation.syntax--definition.syntax--array {
  color: #f2ce00;
}
.syntax--punctuation.syntax--definition.syntax--heading,
.syntax--punctuation.syntax--definition.syntax--identity {
  color: #00a3cc;
}
.syntax--punctuation.syntax--definition.syntax--bold {
  color: #e39400;
  font-weight: bold;
}
.syntax--punctuation.syntax--definition.syntax--italic {
  color: #7a5ccc;
  font-style: italic;
}
.syntax--punctuation.syntax--separator.syntax--inheritance {
  color: #ce6f8f;
}
.syntax--punctuation.syntax--section.syntax--embedded {
  color: #ce6f8f;
}
.syntax--support {
  color: #f2ce00;
  font-style: italic;
  width: calc(1px);
}
.syntax--support.syntax--class {
  color: #00a3cc;
}
.syntax--support.syntax--constant {
  color: #f2ce00;
}
.syntax--support.syntax--function {
  color: #5ccc96;
}
.syntax--support.syntax--function.syntax--any-method {
  color: #b3a1e6;
}
.syntax--ruby .syntax--support.syntax--function {
  color: #ce6f8f;
  font-style: normal;
}
.syntax--support.syntax--quote.syntax--support.syntax--gfm {
  color: #30365F;
  font-style: italic;
}
.syntax--entity {
  color: #00a3cc;
}
.syntax--entity.syntax--name.syntax--function {
  color: #5ccc96;
}
.syntax--entity.syntax--name.syntax--type {
  color: #e39400;
  font-style: italic;
}
.syntax--entity.syntax--other.syntax--inherited-class {
  color: #00a3cc;
  font-style: italic;
}
.syntax--entity.syntax--name.syntax--class,
.syntax--entity.syntax--name.syntax--type.syntax--class {
  color: #b3a1e6;
}
.syntax--entity.syntax--name.syntax--section {
  color: #00a3cc;
}
.syntax--entity.syntax--name.syntax--tag {
  color: #b3a1e6;
}
.syntax--entity.syntax--other.syntax--attribute-name {
  color: #5ccc96;
}
.syntax--entity.syntax--other.syntax--attribute-name.syntax--id {
  color: #00a3cc;
}
.syntax--meta.syntax--class {
  color: #5ccc96;
}
.syntax--meta.syntax--link {
  color: #00a3cc;
}
.syntax--meta.syntax--require {
  color: #00a3cc;
}
.syntax--meta.syntax--selector {
  color: #7a5ccc;
}
.syntax--meta.syntax--delimiter {
  color: #ce6f8f;
}
.syntax--meta.syntax--delimiter.syntax--comma {
  color: #ecf0c1;
}
.syntax--meta.syntax--separator {
  color: #ce6f8f;
}
.syntax--none {
  color: #ecf0c1;
}
.syntax--markup.syntax--bold {
  color: #e39400;
  font-weight: bold;
}
.syntax--markup.syntax--changed {
  color: #7a5ccc;
}
.syntax--markup.syntax--deleted {
  color: #e33400;
}
.syntax--markup.syntax--italic {
  color: #f2ce00;
  font-style: italic;
}
.syntax--markup.syntax--heading .syntax--punctuation.syntax--definition.syntax--heading {
  color: #00a3cc;
}
.syntax--markup.syntax--inserted {
  color: #5ccc96;
}
.syntax--markup.syntax--list {
  color: #e33400;
}
.syntax--markup.syntax--quote {
  color: #e39400;
}
.syntax--markup.syntax--raw.syntax--inline {
  color: #5ccc96;
}
.syntax--source.syntax--gfm .syntax--markup {
  -webkit-font-smoothing: auto;
}
.syntax--source.syntax--gfm .syntax--markup.syntax--heading {
  color: #7a5ccc;
  font-weight: bold;
}
.syntax--source.syntax--gfm .syntax--markup.syntax--link.syntax--underline {
  color: #00a3cc;
}
.syntax--source.syntax--gfm .syntax--markup.syntax--raw {
  color: #b3a1e6;
}
.syntax--source.syntax--gfm .syntax--link .syntax--punctuation {
  color: #ecf0c1;
}
.syntax--source.syntax--gfm .syntax--raw.syntax--inline {
  color: #b3a1e6;
}
.syntax--source.syntax--gfm.syntax--quote,
.syntax--source.syntax--gfm .syntax--comment.syntax--quote {
  color: #30365F;
  font-style: italic;
}
.syntax--source.syntax--gfm .syntax--raw .syntax--support.syntax--gfm {
  color: #b3a1e6;
}
.syntax--source.syntax--gfm .syntax--code .syntax--support.syntax--gfm {
  color: #b3a1e6;
}
.syntax--source.syntax--gfm .syntax--code .syntax--embedded {
  color: #b3a1e6;
}
atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
